import React from 'react';
import { Link } from 'react-router-dom';

const HeroCard = ({ hero }) => {
  return (
    <div className="hero-card">
      <h3>{hero.localized_name}</h3>
      <Link to={`/hero/${hero.id}`}>View Details</Link>
    </div>
  );
};

export default HeroCard;
